import backButton from '/Users/matt/info655-assignment2/src/backButton.png';
import playButton from '/Users/matt/info655-assignment2/src/playButton.png';
import pauseButton from '/Users/matt/info655-assignment2/src/pauseButton.png';
import nextButton from '/Users/matt/info655-assignment2/src/nextButton.png';
import shuffleButton from '/Users/matt/info655-assignment2/src/shuffleButton.png';
import React from 'react';
import Playlist from './Playlist';
import './App.css';
<link rel="stylesheet" type="text/css" href="//fonts.googleapis.com/css?family=Quicksand" />


const App = () => {
  return (
    <div className="app-container">
      <h1 className="playlistTitle">Matt Gisin's Playlist</h1>
      <h2 className="nowPlaying">Now Playing</h2>
      <p className="buttons"> 
      <img className="back" src={backButton} />
      <img className="play" src={playButton} />
      <img className="pause" src={pauseButton} />
      <img className="next" src={nextButton} />
      <img className="shuffle" src={shuffleButton} />
      </p>
      <Playlist />
    </div>
  );
};


export default App;
